import React from 'react';
import productList from '../products.json'

class SearchBar extends React.Component {
    state = {
      search: ''

    };

    handleChange = (event) => {
      this.setState({ search: event.target.value });
    }

    render() {
      return (
        <input
          type="text"
          placeholder="Search..."
          value={this.state.search}
          onChange={this.handleChange}
        />
      );
    }
  }
